import React from "react";
import ProjectContate from "./ProjectContate";

const hello = () => {
  alert("Hello");
};
function ProjectState(props) {
  return (
    <ProjectContate.Provider value={{hello}}>
      {props.children}
    </ProjectContate.Provider>
  );
}

export default ProjectState;
